    abi: ABI = metamorphohyperdriveinstancetest_abi
    # We change `bytecode` as needed for linking, but keep
    # `_raw_bytecode` unchanged as an original copy.
    # pylint: disable=line-too-long
    _raw_bytecode: HexStr | None = HexStr("0x")

    def __init__(self, address: ChecksumAddress | None = None) -> None:
        # Initialize parent Contract class
        super().__init__(address=address)
        self.functions = MetaMorphoHyperdriveInstanceTestContractFunctions(metamorphohyperdriveinstancetest_abi, self.w3, address)  # type: ignore
        self.events = MetaMorphoHyperdriveInstanceTestContractEvents(metamorphohyperdriveinstancetest_abi, self.w3, address)  # type: ignore
        self.errors = MetaMorphoHyperdriveInstanceTestContractErrors()

    events: MetaMorphoHyperdriveInstanceTestContractEvents

